def parse_args():
    p = argparse.ArgumentParser("")

    # grader 
    p.add_argument("-r", dest="root_work", required=True)
    p.add_argument("-m", dest="bpe_var", type=int, default=4) # 0 for nobpe, >1 for max bpe pair freq 
    p.add_argument("-u", dest="use_l2", type=int, default=1) # 1 for l2 scheduler, 0 for loss scheduler 
    p.add_argument("-g", dest="debug", type=int, default=0)

    # transformer model config
    p.add_argument("-v", dest="vocab_size", type=int, default=5000)
    p.add_argument("-p", dest="n_position", type=int, default=512) 
    p.add_argument("-d", dest="n_head", type=int, default=8)
    p.add_argument("-l", dest="n_layer", type=int, default=1)
    p.add_argument("-s", dest="n_embd", type=int, default=64)
    p.add_argument("-n", dest="n_inner", type=int, default=1)
    
    # trainer argument
    p.add_argument("-c", dest="epochs", type=int, default=10) # train epoch per round 
    p.add_argument("-b", dest="batch_size", type=int, default=32)
    return p.parse_args()


class trace2vec():
    def __init__(self, args, debug=False):
        # debug purpose 
        self.log_bpe_infer = 0.0
        self.log_trans_infer = 0.0
        self.log_l2_search = 0.0 

        self.recent_embed = []
        self.landmark_list = []
        self.useL2 = args.use_l2
        self.block_size = args.n_position
        self.n_position = args.n_position

        self.encoder = pybpe.pyBPEencoder(args.bpe_var)
        self.model = GPT2LMHeadModel(config=GPT2Config(
                vocab_size=args.vocab_size,
                n_positions=args.n_position, # TODO, 1024
                n_ctx=args.n_position, # max input len 1024
                n_head=args.n_head, # head count 8
                n_layer=args.n_layer, # internal hidden layer, fnc
                n_embd=args.n_embd, # embedding size  32
                n_inner=args.n_inner,
                output_hidden_states=True,
                bos_token_id=0,
                eos_token_id=0,
                resid_pdrop=0,
                embd_pdrop=0,
                attn_pdrop=0
        ))
        logger.info("model parameter amount: %d" %(self.model.num_parameters()))

        self.train_round = 0
        # configure the training argument 
        self.trained_model_dir = "./trained_model"
        if os.path.isdir(self.trained_model_dir):
            shutil.rmtree(self.trained_model_dir)
        os.mkdir(self.trained_model_dir)

        self.training_args = TrainingArguments(
            output_dir=self.trained_model_dir,
            overwrite_output_dir=True,
            num_train_epochs=args.epochs,
            per_device_train_batch_size=args.batch_size,
            per_device_eval_batch_size=args.batch_size,
            save_steps=10,
            eval_steps=10, 
            save_total_limit=3,
            logging_steps=10,
            load_best_model_at_end=True,
            save_strategy="steps",        # this two should match
            evaluation_strategy="steps",  # this two should match
            do_eval=True,                 # 
            metric_for_best_model="eval_loss", # use loss as evaluation metric for early stopping 
            greater_is_better=False,      # lower loss is better
            # no_cuda=True
        )
        logger.info("Done initializing trace2vec")
    
    def infer(self, pclist, add_buffer=False):
        # bpe infer; pctrace => input_vector
        t1 = time.time()
        newcnt, input_vector = self.encoder.infer(pclist, add_buffer=add_buffer, trace_str=";".join(pclist))
        logger.info("encoder infer inputvector size: %d"%(len(input_vector)))
        self.log_bpe_infer += (time.time() - t1)
        if newcnt:
            return 1, newcnt 
        
        # trans infer; input_vector => embed
        t2 = time.time()
        embed, loss = self.full_vector_to_embedding(input_vector)
        self.log_trans_infer += (time.time() - t2)

        # l2 neighbour seach; embed => score     
        if self.useL2:
            t3 = time.time() 
            score = self.find_nearest_l2_dist(embed)
            self.log_l2_search += (time.time() - t3)
            return 2, score*10000
        else:
            return 2, loss*1000
    
    def find_nearest_l2_dist(self, embed):
        nearest_index, nearest_dist = self.find_nearest_landmark(embed)
        for i in range(0, len(self.recent_embed)):
            try:
                cur = np.linalg.norm(embed - self.recent_embed[i])
            except:
                cur = np.linalg.norm(torch.tensor(embed) - torch.tensor(self.recent_embed[i]))
            nearest_dist = min(nearest_dist, cur)
        self.recent_embed.append(embed)
        self.recent_embed = self.recent_embed[:10]
        return nearest_dist
    
    def build_trainset(self):
        # 1. tokenizer initialization 
        self.tokenizer = GPT2Tokenizer.from_pretrained("./trained_encoder")
        logger.debug("vocab size: %d; end of text?: %s"%(self.tokenizer.vocab_size, self.tokenizer.eos_token))

        # 2. data_collator
        data_collator = DataCollatorForLanguageModeling(
            tokenizer=self.tokenizer, mlm=False
        )

        # 3. dataset for training
        dataset = TextDataset(
            tokenizer=self.tokenizer,
            file_path="./dummy.txt",
            block_size=self.block_size,
            overwrite_cache=True
        )

        dataset.examples = []
        self.landmark_encoded_inputs = [] # for re-generating the landmark list
        new_block = []
        total_l, min_l, max_l = [0, 0, 0]

        trainbuffer = self.encoder.get_train_set()
        logger.debug("BPE buffer has %d traces"%(len(trainbuffer)))
        for tokenid_list in trainbuffer:            
            tokenid_list.append(0)
            landmark_input = []
            # print(tokenid_list)

            # statistics 
            curlen = len(tokenid_list)
            total_l += curlen
            if min_l:
                min_l = min(min_l, curlen)
            else:
                min_l = curlen
            max_l = max(max_l, curlen)

            for token_id in tokenid_list:
                new_block.append(token_id)
                landmark_input.append(token_id)
                if len(new_block) >= self.block_size:
                    dataset.examples.append(new_block[:self.block_size])
                    new_block = new_block[self.block_size:]
            self.landmark_encoded_inputs.append(landmark_input)
        logger.info("avelen: %d, min: %d, max: %d"%(
            total_l / len(trainbuffer), min_l, max_l))
        
        # padding last block using itself 
        if len(new_block):
            multi = int(self.block_size / len(new_block)) + 1
            new_block = new_block * multi
            new_block = new_block[:self.block_size]
            dataset.examples.append(new_block)
        # for each in dataset.examples:
        #     logger.info("block size: %d"%(len(each)))
        logger.info("building trainset: %d blocks"%(len(dataset.examples)))
        return data_collator, dataset

    def train(self):
        data_collator, dataset = self.build_trainset()
        self.train_corelogic(data_collator=data_collator, dataset=dataset)
    
    def train_corelogic(self, data_collator, dataset):
        self.trainer = Trainer(
            model=self.model,               # starting from last training model 
            args=self.training_args,        #  unchanged since initialized 
            data_collator=data_collator,    # new
            train_dataset=dataset,          # new
            eval_dataset=dataset,           # new
            callbacks=[EarlyStoppingCallback(3, 0.01)], # after 3 times of consecutively reducing loss less than 0.03, quit training;
        )
        res = self.trainer.train(resume_from_checkpoint=(True if self.train_round else False))
        logger.info("Training (R%d) loss: %.2f, epoch: %d, time %.2fs"%(
            self.train_round,
            self.trainer.state.best_metric, 
            self.trainer.state.epoch, 
            res[2]["train_runtime"]))
        
        if self.useL2:
            self.refresh_landmark_list()
            # self.log_self_infer_accuracy()
    
    def refresh_landmark_list(self):
        before = len(self.landmark_list)
        self.landmark_list = []
        for input_vector in self.landmark_encoded_inputs:
            embed, loss = self.full_vector_to_embedding(input_vector)
            self.landmark_list.append(embed)
        logger.info("landmarks: %d to %d"%(before, len(self.landmark_list)))

    def full_vector_to_embedding(self, input_vector):
        tmp = input_vector
        embeds = []
        vector = []
        while len(tmp) > 0:
            vector = tmp[:self.n_position]
            tmp = tmp[self.n_position:]

            # pad the last piece 
            paddinglen = max(0, self.n_position - len(vector))
            # pad the tail 
            vec1 = vector + [0] * paddinglen
            vec2 = [1] * len(vector) + [0] * paddinglen
            logger.info("max id is: %d, tokenizer idamx: %d"%(max(vec1), self.tokenizer.vocab_size))
            logger.info("vec1 size: %d, vec2: %d"%(len(vec1), len(vec2)))
            if torch.cuda.is_available():
                one_input = {'input_ids': torch.tensor([vec1]).cuda(), 
                            'attention_mask': torch.tensor([vec2]).cuda()}
            else:
                 one_input = {'input_ids': torch.tensor([vec1]), 
                            'attention_mask': torch.tensor([vec2])}
            with torch.no_grad():
                one_output = self.model(**one_input, labels=one_input["input_ids"])
            logger.info("line 301")
            embeds.append(one_output.hidden_states[-1][-1][-1])
        arrays = [np.array(x.cpu()) for x in embeds]
        sentence_embedding = [np.mean(k) for k in zip(*arrays)]
        return sentence_embedding, one_output.loss
    
    def log_self_infer_accuracy(self):
        tr1list = []
        tr2list = []
        tr3list = []
        tr4list = []

        for input_vector in self.landmark_encoded_inputs:
            tr1list.append(self.full_vector_to_embedding(input_vector[:int(len(input_vector)*0.25)])[0])
            tr2list.append(self.full_vector_to_embedding(input_vector[:int(len(input_vector)*0.5)])[0])
            tr3list.append(self.full_vector_to_embedding(input_vector[:int(len(input_vector)*0.75)])[0])
            tr4list.append(self.full_vector_to_embedding(input_vector[:-1])[0])

        cnt = 0
        for evalist in [tr1list, tr2list, tr3list, tr4list]:
            cnt += 1
            acc1 = 0
            for i in range(0, len(evalist)):
                nearest_index, nearest_dist = self.find_nearest_landmark(evalist[i])
                if i == nearest_index:
                    acc1 += 1
            logger.info("%d%%-set self inference accuracy %.2f%%"%(25*cnt, 100.0 * acc1 / len(evalist)))
    
    def find_nearest_landmark(self, vector):
        nearest_dist = 99
        nearest_index = -1

        for i in range(0, len(self.landmark_list)):        
            try:
                cur = np.linalg.norm(vector - self.landmark_list[i])
            except:
                cur = np.linalg.norm(torch.tensor(vector) - torch.tensor(self.landmark_list[i]))
            if cur < nearest_dist:
                nearest_dist = cur 
                nearest_index = i 
        return nearest_index, nearest_dist

class TraceGrader():
    def __init__(self, args):

        # spin until training condition is triggered 
        self.prerequisites(args)

        # for statistic report 
        self.cost_monitor = { "learn": 0.0, "grade":0.0, "loader": 0.0} 
        self.total_graded = 0

        self.newv_size = 0
        self.upth_size = 0
        self.last_done = 0 # for cleanup
        self.last_train_vocabsize = 0 # for retraining flag 

        self.S2Vmodel = trace2vec(args=args, debug=(True if args.debug else False))
    
    def prerequisites(self, args):
        # buildup the essential directories
        self.output_newv_dir = os.path.join(args.root_work, "grader/queue/") # put new vocab ones
        self.output_upth_dir = os.path.join(args.root_work, "grader-path/queue/") # put unique path ones 
        self.input_seed_pref = os.path.join(args.root_work, "ce_output") # prefix of the uniq seeds 
        self.greenlight = os.path.join(args.root_work, "greenlight")
        self.fzsync_ckpnt = os.path.join(args.root_work, "afl-slave/.synced/ce_output")
        self.fuzzer_queue = os.path.join(args.root_work, "afl-slave/queue")

        cnt = 0
        for dir in [self.output_newv_dir, self.output_upth_dir]:
            while not os.path.isdir(dir):
                time.sleep(SLEEPINT)
            cnt += 1
            logger.debug("Prerequisites met [%d/4]: %s"%(cnt, dir))
        
        while not os.path.exists(FIFO):
            time.sleep(SLEEPINT)
        logger.debug("Prerequisites met [3/4]: fifo file exists ")

        while not os.path.isfile(self.greenlight):
            time.sleep(SLEEPINT)
        logger.debug("Prerequisites met [4/4]: greenlight s2v training")

    def executor(self):
        logger.info("Enter executor")
        while True:
            t1 = time.time()
            train_batch = []
            grade_batch = []
            with open(FIFO) as fifo:
                logger.info("Open fifo to read!")
                newdata = fifo.readline()
                logger.info("read(%d)"%(len(newdata)))
                if len(newdata) == 0:
                    continue
                while newdata != "END\n":                    
                    entries = newdata.split(";")
                    status = entries[-2]
                    trace = entries[:-2]
                    if status.startswith("0@"):
                        train_batch.append(trace)                        
                        # fileid = int(status[2:])
                    elif status.startswith("1@"):
                        folderid, fileid = [int(i) for i in (status[2:]).split("-")]
                        grade_batch.append([trace, folderid, fileid])
                        # logger.info("gradebatch: %d"%(fileid))
                        #TODO: do the grading right now?
                    elif status.startswith("2@"):
                        pass 
                    elif status.startswith("3@"):
                        folderid = "f"
                        fileid = int(status[2:])
                        grade_batch.append([trace, folderid, fileid])
                    else:
                        logger.warning("Wrong status: %s"%(status))
                    newdata = fifo.readline()     
            self.cost_monitor["loader"] += (time.time() - t1)

            logger.info("trainsize: %d, gradesize: %d"%(len(train_batch), len(grade_batch)))

            if len(train_batch):
                t1 = time.time()
                self.learn_round(train_batch)
                self.cost_monitor["learn"] += (time.time() - t1)
            
            if self.S2Vmodel.train_round and len(grade_batch):
                t1 = time.time()
                self.grade_round(grade_batch)
                self.cost_monitor["grade"] += (time.time() - t1)

            self.cost_report()
            break
    
    def learn_round(self, train_batch):
        if self.S2Vmodel.train_round and \
            self.S2Vmodel.encoder.get_vocab_size() < 1.10 * self.last_train_vocabsize:
            self.S2Vmodel.build_trainset()
            self.S2Vmodel.refresh_landmark_list()
        else:
            t1 = time.time()
            self.S2Vmodel.encoder.train(train_batch)
            logger.info("encoder training took: %.2fs"%(time.time() - t1))
            self.S2Vmodel.train()
            self.last_train_vocabsize = self.S2Vmodel.encoder.get_vocab_size()
        
        # before move to next round
        self.S2Vmodel.train_round += 1
    
    def grade_round(self, grade_list):
        logger.info("grader round: %d"%(len(grade_list)))
        for rawtrace, dir_id, seed_id in grade_list:
            self.total_graded += 1
            tier, score = self.S2Vmodel.infer(rawtrace, add_buffer=False)
            # logger.info("%d-%d\n"%(tier, score))
            if dir_id != "f":
                rawseed_name = os.path.join(self.input_seed_pref + str(dir_id), "queue/id:%06d"%(seed_id))
            else:
                rawseed_name = glob.glob(os.path.join(self.fuzzer_queue, "id:%06d*"%(seed_id)))
                rawseed_name = rawseed_name[0]
                logger.info("should be fzq seeds that does not have +cov suffix")
            if tier == 1:
                newname = os.path.join(self.output_newv_dir, "id:%06d_%.2f"%(self.newv_size, score))
                self.newv_size += 1
            if tier == 2:
                newname = os.path.join(self.output_upth_dir, "id:%06d_%.2f"%(self.upth_size, score))
                self.upth_size += 1
            
            # seed file
            fz_sync_last = self.get_fz_seen_id(fname=self.fzsync_ckpnt+str(dir_id))
            if seed_id < fz_sync_last:
                os.rename(rawseed_name, newname)
                self.outdated_rawce_cleanup(dir_id=dir_id, seed_id=seed_id)
            else:
                shutil.copy2(rawseed_name, newname)

    def get_fz_seen_id(self, fname):
        try:
            with open(fname, "r") as fp:
                a = int(np.fromfile(fp, dtype=np.uint32))
            return a
        except:
            return 0
    
    def outdated_rawce_cleanup(self, dir_id, seed_id):
        for next_to_go in range(self.last_done, seed_id):
            fname = os.path.join(self.input_seed_pref + str(dir_id), "queue/id:%06d"%(next_to_go))
            if os.path.isfile(fname):
                os.remove(fname)
        # logger.info("cleanup range(%d): %d - %d"%(dir_id, self.last_done, seed_id))
        self.last_done = seed_id
    
    def cost_report(self):
        total = sum(self.cost_monitor.values())
        total = max(total, 0.00001)
        self.cost_monitor["grade"] = max(self.cost_monitor["grade"], 0.00001)
        logger.info("loader: %.2fs (%.2f%%); learn: %.2fs (%.2f%%); grade: %.2fs (%.2f%%); grading speed: %.2f seeds/s,total: %.2fs, %d seeds"%(
            self.cost_monitor["loader"], self.cost_monitor["loader"] / total * 100,
            self.cost_monitor["learn"], self.cost_monitor["learn"] / total * 100,
            self.cost_monitor["grade"], self.cost_monitor["grade"] / total * 100,
            self.total_graded / self.cost_monitor["grade"],
            total, self.total_graded
        ))
        logger.info("bpe-infer: %.2fs, trans-infer: %.2fs, neighbour l2: %.2fs"%(
            self.S2Vmodel.log_bpe_infer,
            self.S2Vmodel.log_trans_infer,
            self.S2Vmodel.log_l2_search
        ))

def main():
    args = parse_args()
    grader = TraceGrader(args)
    grader.executor()


